          }

opping the charts in 25 countries including Ricks native UK and the US Billboard Hot 100.  It also won the Brit Award for Best single in 1988. Stock Aitken and Waterman wrote and produced the track which was the lead-off single and lead track from Ricks debut LP Whenever You Need Somebody.  The album was itself a UK number one and would go on to sell over 15 million copies worldwide.\n\nThe legendary video was directed by Simon West  who later went on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":128,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CNEEEM2rARgBIhMIm4XBh_nthwMV3yDxBR2B4wcQSMS7ga29mI6GdQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbUhJdFF6V3FhSVlsWnhHc2NuWWJfaVpoZ2Rjd3xBQ3Jtc0tsbWxQQktEX3hiTVY0YkpjbVB1d3BxMmJJNzg1QXpTUWdJMkpucmN5dzhmS3loMVAtenVwdjhlRGZXMldlS2RTZGRBZ3NmVmtyZXJ0QWlETC1MWFp6UWdmSEZ4QVdNbFRBcnJGajFYZm5ON1ZlLVA2dw\u0026q=https%3A%2F%2FRickAstley.lnk.to%2FAreWeThereYetFA%2Fitunes\u0026v=dQw4w9WgXcQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbUhJdFF6V3FhSVlsWnhHc2NuWWJfaVpoZ2Rjd3xBQ3Jtc0tsbWxQQktEX3hiTVY0YkpjbVB1d3BxMmJJNzg1QXpTUWdJMkpucmN5dzhmS3loMVAtenVwdjhlRGZXMldlS2RTZGRBZ3NmVmtyZXJ0QWlETC1MWFp6UWdmSEZ4QVdNbFRBcnJGajFYZm5ON1ZlLVA2dw\u0026q=https%3A%2F%2FRickAstley.lnk.to%2FAreWeThereYetFA%2Fitunes\u0026v=dQw4w9WgXcQ","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":923,"length":33,"onTap":{"innertubeCommand":{"clickTrackingParams":"CNEEEM2rARgBIhMIm4XBh_nthwMV3yDxBR2B4wcQSMS7ga29mI6GdQ==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbjJ4ZThqWnFHbDdPYUFpYWVPdW5XdGRUSVFOUXxBQ3Jtc0tsc0o0eEd1dXBXbmQ1T1NrYWRPVVNhNzNYTzVGSmJ6U0MwVWUtUHVvMHlRLURWcGdKY25rQXpPVVR1QmNnUGhtaDNFRjhwYmRPSHdJWXAxX1hWY0FIWFdVb2xlbGVqMU9KTFQwTHE1d0Q4MkpxT2Zybw\u0026q=https%3A%2F%2FRickAstley.lnk.to%2FYTSubID\u0026v=dQw4w9WgXcQ","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbjJ4ZThqWnFHbDdPYUFpYWVPdW5XdGRUSVFOUXxBQ3Jtc0tsc0o0eEd1dXBXbmQ1T1NrYWRPVVNhNzNYTzVGSmJ6U0MwVWUtUHVvMHlRLURWcGdKY25rQXpPVVR1QmNnUGhtaDNFRj ent on to make Hollywood blockbusters such as Con Air, Lara Croft  Tomb Raider and The Expendables 2.  The video passed the 1bn YouTube views milestone on 28 July 2021.\n\nSubscribe to the official Rick Astley YouTube channel: https://RickAstley.lnk.to/YTSubID\n\nFollow Rick Astley:\nFacebook: https://RickAstley.lnk.to/FBFollowID \nTwitter: https://RickAstley.lnk.to/TwitterID \nInstagram: https://RickAstley.lnk.to/InstagramID \nWebsite: https://RickAstley.lnk.to/storeID \nTikTok: https://RickAstley.lnk.to/TikTokID\n\nListen to Rick Astley:\nSpotify: https://RickAstley.lnk.to/SpotifyID \nApple Music: https://RickAstley.lnk.to/AppleMusicID \nAmazon Music: https://RickAstley.lnk.to/AmazonMusicID \nDeezer: https://RickAstley.lnk.to/DeezerID \n\nLyrics:\nWere no strangers to love\nYou know the rules and so do I\nA full commitments what Im thinking of\nYou wouldnt get this from any other guy\n\nI just wanna tell you how Im feeling\nGotta make you understand\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\nWeve known each other for so long\nYour hearts been aching but youre too shy to say it\nInside we both know whats been going on\nWe know the game and were gonna play it\n\nAnd if you ask me how Im feeling\nDont tell me youre too blind to see\n\nNever gonna give you up\nNever gonna let you down\nNever gonna run around and desert you\nNever gonna make you cry\nNever gonna say goodbye\nNever gonna tell a lie and hurt you\n\n#RickAstley #NeverGonnaGiveYouUp #WheneverYouNeedSomebody #OfficialMusicVideo","commandRuns":[{"startIndex":128,"length":40,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBgQ040EGAMiEwibhcGH-e2HAxXfIPEFHYHjBxBIxLuBrb2YjoZ1","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXVMelZqN29WQzVQTE1HUWRZd1ZJMVpreUZMZ3xBQ3Jtc0ttbWttQ3A4cDg5WlBqRW
